import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import { RootStateType } from '../store/store'; // типизация всего стейта( для типизации state)
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import CircularProgress from '@material-ui/core/CircularProgress';
import { Box, Container, Button } from '@material-ui/core';
import ShoppingCartOutlinedIcon from '@material-ui/icons/ShoppingCartOutlined';
import DeleteForeverOutlinedIcon from '@material-ui/icons/DeleteForeverOutlined';
import ActiveLastBreadcrumb from '../components/ActiveLastBreadcrumb';
import { connect } from 'react-redux';
import { DeleteForeverOutlined } from '@material-ui/icons';

//типизация---------------------------------------------------------------------
type MapStateToPropsType = {};
type MapDispathPropsType = {};
type PropsType = MapStateToPropsType & MapDispathPropsType;

//-----------------------------------------------------------------
const useStyles = makeStyles((theme) => ({
  breadcrumb: {
    marginTop: 15,
  },
  shoppingCartOutlinedIcon: {
    fontSize: '24px',
    position: 'relative',
    top: '3px',
    right: '10px',
  },
  deleteCart: {
    display: 'flex',
    position: 'relative',
    top: '7px',
    cursor: 'pointer',
    '&:hover': {
      color: '#000',
    },
  },
}));

const Cart: React.FC<PropsType> = ({}) => {
  const classes = useStyles();

  useEffect(() => {
    // eslint-disable-next-line
  }, []);

  return (
    <Container maxWidth="lg">
      <Box className={classes.breadcrumb}>
        <ActiveLastBreadcrumb name="Корзина" />
      </Box>
      <Container maxWidth="sm">
        <Box display="flex" marginTop={5} justifyContent="space-between">
          <Typography
            component="h1"
            variant="h5"
            align="center"
            style={{
              display: 'flex',
            }}
          >
            <ShoppingCartOutlinedIcon
              className={classes.shoppingCartOutlinedIcon}
            />{' '}
            Корзина
          </Typography>
          <Typography color="textSecondary">
            <DeleteForeverOutlined
              style={{ fontSize: '16px', position: 'relative', top: '3px' }}
            />
            очистить корзину
          </Typography>
        </Box>
      </Container>
    </Container>
  );
};

const mapStateToProps = (state: RootStateType): MapStateToPropsType => {
  return {};
};
export default connect<
  MapStateToPropsType,
  MapDispathPropsType,
  unknown, // первичные пропсы
  RootStateType
>(
  mapStateToProps,
  {}
)(Cart);
